  on Pungo National Wildlife Refuge for 1966 and after. The soil and moisture conservation
  plan includes treatment of each acre according to its needs for protections and
  improvement. Application of approved practices throughout the refuge will facilitate
  utilization of soil and water resources in attainment of refuge objectives. The
  purpose of this plan is to increase habitat utilization for migratory birds.\",\n\t\"license_title\":
